package lessons;

public class MyClassFor {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] myarry = {100,67,234,89,178};
		
		for(int i=0;i<myarry.length;i++) {
			System.out.println(myarry[i]);
		}
		int sum = 0;
		for(int i=0;i<=100;i++) {
			sum +=i;
		}
		System.out.println(sum);
	}

}
